Друзья, мне не терпится познакомиться с вами, а вас познакомить с нами, поэтому 

*`завтра, 26 сентября (суббота) в 11.00 по мск`* приглашаю вас на короткую *`организационную встречу`*, где расскажу:

• о курсе (особенности, преимущества, длительность)
• о слаке (плюсы, минусы, подводные камни)
• о дедлайнах (мягкие и жесткие)
• о ролях (преподаватель, наставник, куратор)
*Несколько слов о формате:*
Встреча пройдет в Zoom (<https://zoom.us/>) и займёт примерно 30-40 минут.
Ссылка на подключение к вебинару будет в чате info перед встречей.

*Что нужно проверить перед созвоном:*
• установлен ли Zoom на устройстве (небольшая инструкция в треде);
• всё ли в порядке с Интернетом;
• в помещении тихо;
• микрофон и камера работают;

У нас есть некоторые *рекомендации*, которые помогут сделать общение в онлайне комфортным для всех:
• укажите свои имя и фамилию полностью и на русском языке, чтобы было ясно, к кому обращаться во время беседы;
• будьте вовремя (ждём не больше 5 минут);
• отключайте микрофон, если не говорите сейчас;
• включите видео на все время трансляции, чтобы можно было говорить с вами, а не с черным экраном (можно отключать при необходимости, но ненадолго);
• будьте вежливы со всеми участниками встречи

Не все могут присутствовать на консультации очно. Поэтому будьте готовы к тому, что *консультация будет записана на видео*.
И до встречи! :black_heart:
