Запускаю мини-опрос для самых любопытных :smile:

Много ли у нас студентов с техническим образованием? Или большинство из вас решили кардинально сменить вектор развития?

Ставьте реакцию, если:
:triangular_ruler: — учусь/учился(лась) на техническом направлении, обладаю глубокими знаниями математики;
:straight_ruler: — учусь/учился(лась) на техническом направлении, но многое уже забыл(а);
:books: — учусь/учился(лась) на гуманитарном направлении, но с математикой на «ты»;
:art: — учусь/учился(лась) на гуманитарном направлении, помню только школьную математику;
:thought_balloon: — свой вариант напишу в треде

И вне конкурса:
:chart_with_upwards_trend: — хотел(а) бы подтянуть знания математики

Пишите в треде, как вы считаете, каких математических знаний вам не хватает для прохождения курса или решения рабочих задач :point_down:
